// src/Home.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { exec } from 'child_process';
import path from 'path';
import fs from 'fs/promises';
import './App.css';
import appLogo from './assets/summarease.png';
import companyLogo from './assets/creme_brulee.jpg';
import { Link } from 'react-router-dom';
import SearchBar from './SearchBar';


function Home() {
  const [selectedFiles, setSelectedFiles] = useState([]);
  const [dragOver, setDragOver] = useState(false);
  const [processing, setProcessing] = useState(false);

  const handleFileSelect = (event) => {
    const files = Array.from(event.target.files);
    setSelectedFiles(prev => [...prev, ...files]);
  };

  const handleDragOver = (event) => {
    event.preventDefault();
    setDragOver(true);
  };

  const handleDragLeave = () => {
    setDragOver(false);
  };

  const handleDrop = (event) => {
    event.preventDefault();
    setDragOver(false);
    const files = Array.from(event.dataTransfer.files);
    setSelectedFiles(prev => [...prev, ...files]);
  };

  const handlePDFClick = () => {
    const input = document.createElement('input');
    input.type = 'file';
    input.accept = '.pdf';
    input.multiple = true;
    input.onchange = handleFileSelect;
    input.click();
  };

  const handleVideoClick = () => {
    const input = document.createElement('input');
    input.type = 'file';
    input.accept = 'video/*';
    input.multiple = true;
    input.onchange = handleFileSelect;
    input.click();
  };

  const handleSubmit = async () => {
    if (selectedFiles.length === 0) return;

    setProcessing(true);
    try {
      // Create an array to store temporary file paths
      const tempFiles = [];

      // Process each file
      for (const file of selectedFiles) {
        const fileType = file.name.split('.').pop().toLowerCase();
        const uniqueFileName = `${Date.now()}_${file.name}`;
        const tempFilePath = path.join('/tmp/summarease_uploads', uniqueFileName);

        // Save file to temporary location
        await fs.writeFile(tempFilePath, Buffer.from(await file.arrayBuffer()));
        tempFiles.push({
          originalName: file.name,
          path: tempFilePath,
          type: fileType
        });

        // Process PDF files immediately
        if (fileType === 'pdf') {
          await processPDF(tempFilePath);
        }
      }

      // Redirect to downloads page with file paths
      navigate('/downloads', { 
        state: { 
          files: tempFiles,
          processingComplete: true 
        } 
      });

      // Reset after processing
      setSelectedFiles([]);
      setProcessing(false);
    } catch (error) {
      console.error('Error processing files:', error);
      setProcessing(false);
      alert('Error processing files. Please try again.');
    }
  };

  // Helper functions for file processing
  const processPDF = async (filePath) => {
    return new Promise((resolve, reject) => {
      exec(`python3 ${path.resolve(__dirname, '../pdf_extraction.py')} ${filePath}`, (error, stdout, stderr) => {
        if (error) {
          reject(error);
        } else {
          resolve(stdout);
        }
      });
    });
  };

  return (
    <div className="App">
      <div className="background-logo" style={{ backgroundImage: `url(${companyLogo})` }} />

		<header className="app-header">
		  <div style={{ display: 'flex', alignItems: 'center' }}>
			<img src={appLogo} alt="App Logo" className="header-logo" />
			<SearchBar />
		  </div>
		  <nav className="nav-menu">
			<Link to="/" className="nav-item">Home</Link>
			<Link to="/downloads" className="nav-item">Downloads</Link>
			<Link to="/history" className="nav-item">User History</Link>
		  </nav>
		</header>

      <main className="content">
        <h1>Welcome to Summarease</h1>
        <div 
          className={`drop-zone ${dragOver ? 'drag-over' : ''}`} 
          onDragOver={handleDragOver}
          onDragLeave={handleDragLeave}
          onDrop={handleDrop}
        >
          <div className="buttons">
            <button 
              className="btn eraser pink" 
              onClick={handlePDFClick}
            >
              üìù Add PDF Files
            </button>
            <button 
              className="btn eraser blue" 
              onClick={handleVideoClick}
            >
              üé• Add Videos
            </button>
          </div>
          {selectedFiles.length > 0 && (
            <div className="selected-files">
              <h3>Selected Files:</h3>
              <ul>
                {selectedFiles.map((file, index) => (
                  <li key={index}>{file.name}</li>
                ))}
              </ul>
              <button 
                className="submit-button" 
                onClick={handleSubmit}
                disabled={processing}
              >
                {processing ? 'Processing...' : 'üöÄ Submit Files'}
              </button>
            </div>
          )}
        </div>
      </main>
    </div>
  );
}

export default Home;
